import React from 'react'
import Navbar from '../Navbar'
import PopularCourses from '../../PopularCourses/PopularCourses'
import './popular'

const Courses = () => {
  return (
    <div>
      <Navbar />

      <PopularCourses val={'dispAll'} />
    </div>
  )
}

export default Courses
